import React, {useState, useEffect}from "react";
import axios from "axios";
import './Body.css';
const baseURL = "http://localhost:7000/doctorData/";

function Body()
{
   const [previous, setNew] = React.useState([{}]);

  React.useEffect(() => {
  axios.get(baseURL)
    .then((response) => {
      setNew(response.data);
    });
  }, []);

   if (!previous) return null;

    return (

      <div>
        <img src="slides/pic10.jpg" className="bodyImage"></img>
      {previous.map((pre) => (

        <div class="container py-5">
  <div class="d-flex justify-content-center">
    <div class="col-8">
      <div class="card bg-dark text-white"> <img src="images/card.png" class="card-img" alt="..."></img>
        <div class="card-img-overlay">
          <h5 class="card-title">Card title</h5>
          <p class="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
          <p class="card-text">Last updated 3 mins ago</p>
        </div>
      </div>
    </div>
  </div>
</div>
        ))}
      </div>
    );
}
export default Body;
